import React from 'react'
import List from './ListCategory'

class SideBar extends React.Component{

    render() {
        let list = List;
        return <div className="pad">{
            list.map((value => {
                if (value.children) {
                    let list2 =  value.children;
                    list2.map((item => {
                            console.log(item);
                            return <div id={item.id}   >
                                <label className="containerForTree">{item.name}
                                    <input type="checkbox"/>
                                    <span className="checkmark"></span>
                                </label>
                            </div>
                        }
                    ))
                }
                return <div key={value.id}>
                <LabelTree value={value}/>
                </div>

            }))
        }
        </div>
    }


}

function LabelTree(props) {


    return(
        <div id={props.value.id}   >
        <label className="containerForTree">{props.value.name}
            <input type="checkbox" />
            <span className="checkmark"></span>
        </label>
        </div>
    )


}

export default SideBar
